<small>1% \u7B49\u4E8E\u7236\u5143\u7D20\u7684\u767E\u5206\u4E4B\u4E00\u3002\u4E00\u822C\u7528\u4E8E\u8BBE\u7F6E\u5BB9\u5668\u7684\u5BBD\u9AD8\u7B49\u3002</small>
